def solution(stdin: str) -> str:
    """
    Given a grid of size n x m consisting of '*' and '.' characters, find the maximum number of stars that can be drawn using the given grid.
    The number of stars should be less than or equal to n * m.
    The output should contain the position and size of each star.
    """
    n, m = map(int, stdin.split()[0:2])
    grid = [stdin.strip() for _ in range(n)]

    def valid_star_position(x, y, s):
        """
        Check if the given position is valid for a star of size s.
        """
        for i in range(s):
            for j in range(s):
                if grid[x+i][y+j] == '*' or grid[x+i][y+j] == '.':
                    continue
                return False
        return True

    stars = []
    for i in range(n):
        for j in range(m):
            if grid[i][j] == '*':
                continue
            for s in range(1, n*m+1):
                if valid_star_position(i, j, s):
                    stars.append((i, j, s))
                    break
            if len(stars) >= n*m:
                return "-1"

    if not stars:
        return "-1"

    return f"{len(stars)}\n" + "\n".join(map(lambda x: " ".join(map(str, x)), stars))

