        for w, u, v in edges:
            if weight < w:
                continue
            pu, pv = find(u), find(v)
            if pu!= pv:
                mst.append((u, v, w))
                mst_cost += w
                weight -= w
                parent[pu] = pv
        return mst, mst_cost
    initial_mst, initial_mst_cost = kruskal(float('inf'))
