    votes = list(map(int, stdin.readline().strip().split()))
    if n == 1:
        return str(sum(votes))
    t, a = votes
    if t == a:
        return str(t * (n + 1))
    t, a = t * (n - 1), a * (n - 1)
    if a == 0:
        return str(t)
    g = math.gcd(t, a)
    t //= g
    a //= g
    if t < a:
        t, a = a, t
    total = t * (n - 1)
    for i in range(1, n):
        t, a = t * votes[i][0], a * votes[i][1]
        if a == 0:
            return str(total)
        g = math.gcd(t, a)
        t //= g
        a //= g
        if t < a:
            t, a = a, t
        total += t
    return str(total)

