    for i in range(n):
        for j in range(i+1, n):
            diff = sum(a!= b for a, b in zip(strings[i], strings[j]))
            matrix[i][j] = diff
            matrix[j][i] = diff

    # Compute the unlikeliness of each tree
    unlikeliness = [matrix[i][j] + matrix[j][k] + matrix[k][i] for i in range(n) for j in range(i+1, n) for k in range(j+1, n)]

    # Find the tree with minimal unlikeliness
    min_unlikeliness = min(unlikeliness)
    tree_indices = [i for i, u in enumerate(unlikeliness) if u == min_unlikeliness]
    tree = [[False for _ in range(n)] for _ in range(n)]
    for i, j, k in combinations(tree_indices, 3):
        if matrix[i][j] + matrix[j][k] + matrix[k][i] == min_unlikeliness:
            tree[i][j] = tree[j][k] = tree[k][i] = True

    # Output the minimal unlikeliness and the edges of the tree
    stdout = f"{min_unlikeliness}\n"
