                frame[i] = frame[i][:j] + '#' + frame[i][j+1:]
            elif i % 2 == j % 2:
                frame[i] = frame[i][:j] + '#' + frame[i][j+1:]

    # Add the puzzle to the frame
    for i in range(U, M + U):
        for j in range(L, N + L):
            if puzzle[i-U][j-L] == 'i':
                frame[i+1] = frame[i+1][:j*2+1] + 'i' + frame[i+1][j*2+2:]
            elif puzzle[i-U][j-L] == 'r':
