        (x1, y1) = key_table[plaintext[i]]
        (x2, y2) = key_table[plaintext[i+1]]
        if x1 == x2:
            ciphertext += key_table[key_table[(plaintext[i]+'x') if y1 == 4 else (plaintext[i+1]+'x')][1]][0]
            ciphertext += key_table[key_table[(plaintext[i]+'x') if y1 == 4 else (plaintext[i+1]+'x')][1]][1]
        elif y1 == y2:
            ciphertext += key_table[key_table[key_table[(plaintext[i]+'x') if x1 == 4 else (plaintext[i+1]+'x')][1]][0]]
            ciphertext += key_table[key_table[key_table[(plaintext[i]+'x') if x1 == 4 else (plaintext[i+1]+'x')][1]][0]]
        else:
            ciphertext += key_table[(key_table[plaintext[i]][0], key_table[plaintext[i+1]][1])]
            ciphertext += key_table[(key_table[plaintext[i]][1], key_table[plaintext[i+1]][0])]

    return ciphertext.upper()

