    # Parse input
    lines = stdin.strip().split('\n')
    r, c = map(int, lines[0].split())
    img = [[char for char in line.strip()] for line in lines[1:]]

    # Find all connected components in the image
    visited = [[False for _ in range(c)] for _ in range(r)]
    def dfs(i, j):
        if visited[i][j]:
            return False
        visited[i][j] = True
        for ni, nj in [(i-1,j), (i+1,j), (i,j-1), (i,j+1)]:
            if 0 <= ni < r and 0 <= nj < c and img[ni][nj]!= 'C':
                dfs(ni, nj)
        return True

    islands = 0
    for i in range(r):
        for j in range(c):
            if not visited[i][j] and img[i][j]!= 'C':
                islands += 1
                dfs(i, j)

    return str(islands)

